trailingComments.value:
*
 * 作者主页加载完成后回调
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * const params = {
 *   source: 'authorHome',
 *   background: {
 *     action: 'scroll',
 *     mode: 'alpha',
 *     webTopHeight: 200,
 *     imageData: '',
 *     alphaTitle: true,
 *   },
 * };
 * libSQ.exec('author-home-finished', { params }).catch((err) => {
 *   alert(`[author-home-finished][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 * });

